

import React from 'react';
import top10Data from '../data/top10Data';

export default function Home() {
  const { top10Celebrities, top10youtubers, top10contentCreators, top10IPLTeams } = top10Data;

  const renderTable = (data, tableName) => (
    <div className="flex flex-col text-black mb-20 m-2  dark:bg-gray-700 dark:text-white flex-1">
      <h2 className="text-xl font-bold mb-4 text-white justify-center text-center">{tableName}</h2>
      <div className="overflow-x-auto">
        <table className="w-full table-auto  border border-gray-300 rounded-lg dark:bg-gray-700">
          <thead>
            <tr className="bg-gray-200  dark:bg-gray-700">
              <th className="border border-gray-300 px-4 py-2">Rank</th>
              <th className="border border-gray-300 px-4 py-2">About</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr key={item.id} className={item.rank % 2 === 0 ? "bg-gray-100" : "bg-white"}>
                <td className="border border-gray-300 px-4 py-2  dark:bg-gray-700">
                  <p> Rank : {item.rank} </p>
                  <img src={item.image} alt="" className="w-16 h-16 object-cover" />
                </td>
                <td className="border border-gray-300 px-4 py-2  dark:bg-gray-700">
                  <div className="flex flex-col">
                    <p>Name:  {item.name}</p>
                    <p>Instagram:  {item.instaFollowers}</p>
                    <p>YouTube:  {item.youtubeSubscribers}</p>
                    <p>Facebook:  {item.facebookFollowers}</p>
                    <p>Twitter:  {item.twitterFollowers}</p>
                  </div>
                  <div className="flex justify-between mt-2">
                    {instalogo(item)}
                    {facebooklogo(item)}
                    {twitterlogo(item)}
                    {youtubelogo(item)}
                  </div>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );

  const instalogo = (item) => (
    <a href={item.instaId} className="h-6 w-6">
      <img alt="svgImg" src="data:image/svg+xml;base64," />
    </a>
  )

  const youtubelogo = (item) => (
    <a href={item.instaId} className="h-6 w-6">
      <img alt="svgImg" src="data:image/svg+xml;base64," />
    </a>
  )

  const twitterlogo = (item) => (
    <a href={item.instaId} className="h-6 w-6">
      <img alt="svgImg" src="data:image/svg+xml;base64," />

    </a>
  )

  const facebooklogo = (item) => (
    <a href={item.instaId} className="h-6 w-6">
      <img alt="svgImg" src="data:image/svg+xml;base64," />
    </a>
  )

  return (
    <div className='flex gap-10 flex-wrap '>
      {renderTable(top10Celebrities, "Top 10 Celebrities")}
      {renderTable(top10youtubers, "Top 10 YouTubers")}
      {renderTable(top10contentCreators, "Top 10 Content Creators")}
      {renderTable(top10IPLTeams, "Top 10 IPL Teams")}
    </div>
  );
}
